function CheckAsyncProcesses(){if(window.XMLHttpRequest){xmlhttp=new XMLHttpRequest}else{xmlhttp=new ActiveXObject("Microsoft.XMLHTTP")}xmlhttp.onreadystatechange=function(){if(xmlhttp.readyState==4&&xmlhttp.status==200){if(xmlhttp.responseText!=""){switch(xmlhttp.responseText.trim()){case"0x10001029":{let div=document.getElementById("data_uploading_notice");div.style.visibility="visible";div.style.display="block";setTimeout(CheckAsyncProcesses,3e4)}break;case"0x10001011":{let div=document.getElementById("data_uploading_notice");div.style.visibility="hidden";div.style.display="none";Swal.fire({title:"Success!",text:"Data uploading has completed!!",icon:"success",timer:3e3})}break}}}};xmlhttp.open("GET","Chk_AsyncProcesses.php",true);xmlhttp.send()}